import React from 'react'

class ButtonContainer extends React.Component {

    buttons = () => {
        return this.props.categories
    }

    render() {
        return (
            <>
                <h1>ButtonContainer</h1>
                {this.buttons()}
            </>
        )
    }
}

export default ButtonContainer
